 # Construct a lazy task graph \n   der = Derivee(gt[::2], 1) \n   cpt =  da.linalg.norm(der, axis=(1,2))\n\n   # Submit the task graph to the scheduler\n   s = Adaptor.client.compute(cpt)\n   # Print the result, note that \"s\" is a future object, to get the result of the computation, we call `s.result()` to retreive it.  \n   print(s.result(), flush=True)\n\nprint(\"Done in \", time.time() -t, \"secondes\")\nAdaptor.client.shutdown()\n\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{"below":[{"id":"1012"}],"center":[{"id":"1015"},{"id":"1019"}],"left":[{"id":"1016"}],"renderers":[{"id":"1034"}],"sizing_mode":"stretch_both","title":{"id":"1413"},"toolbar":{"id":"1025"},"x_range":{"id":"1004"},"x_scale":{"id":"1008"},"y_range":{"id":"1006"},"y_scale":{"id":"1010"}},"id":"1003","subtype":"Figure","type":"Plot"},{"attributes":{"coordinates":null,"formatter":{"id":"1451"},"group":null,"major_label_orientation":-0.3490658503988659,"major_label_policy":{"id":"1452"},"ticker":{"id":"1164"}},"id":"1163","type":"CategoricalAxis"},{"attributes":{"below":[{"id":"1292"}],"center":[{"id":"1295"},{"id":"1299"},{"id":"1334"}],"height":150,"left":[{"id":"1296"}],"renderers":[{"id":"1311"},{"id":"1340"}],"sizing_mode":"stretch_both","title":{"id":"1283"},"toolbar":{"id":"1303"},"toolbar_location":"above","x_range":{"id":"1215"},"x_scale":{"id":"1288"},"y_range":{"id":"1286"},"y_scale":{"id":"1290"}},"id":"1282","subtype":"Figure","type":"Plot"},{"attributes":{"bottom":{"field":"bottom"},"fill_alpha":{"value":0.2},"fill_color":{"field":"color"},"hatch_alpha":{"value":0.2},"hatch_color":{"field":"color"},"left":{"field":"left"},"line_alpha":{"value":0.2},"line_width":{"value":2},"right":{"field":"right"},"top":{"field":"top"}},"id":"1069","type":"Quad"},{"attributes":{"high":1,"low":0,"palette":["#ffffFF","#fefeFF","#fdfdFF","#fcfcFF","#fbfbFF","#fafaFF","#f9f9FF","#f8f8FF","#f7f7FF","#f6f6FF","#f5f5FF","#f4f4FF","#f3f3FF","#f2f2FF","#f1f1FF","#f0f0FF","#
